import React from 'react';
import './Home.css';
import pit from './img/pit.jpg';
import login_img from './img/login_img.jpeg';


import { BrowserRouter as Router} from "react-router-dom";

class Home extends React.Component {

    render() {
    return (<Router>
        <div class="home">
            <div class="topnav">
                <img href={Home} alt="sorry" height="120%" width="15%" src={pit}/>
                <a href="/login">rgeb</a>
            </div>
            <div class="image">
                <img alt="sorry" src={login_img} height="100%" width="100%"/>
                <a class="btn" href="/login"><span>Register/Login </span></a>
            </div>

            <div class="about">

            </div>
            <div class="contact">

            </div>    
        </div>
        </Router>
    );
    }
}
export default Home;
